import React from 'react';

function Shayari({title, author, content}) {
    return(
        <div className='shayari-card'>
            <h2>{title}</h2>
            <h4>{author}</h4>
            <p>{content}</p>
            <p></p>
        </div>
    )
}
export default Shayari;
